These are real-life data from large-scale nationally representative surveys that include variables relating to (social) trust. The datasets have been prepared for use in lab exercises and the assignment. All the original data are freely available for research purposes from their respective data repositories, but they generally require registration before the data can be accessed. The datasets listed on this page are slightly processed versions of the raw data to make them more easily usable by students. Typically, variable types and labels have been corrected and the number of variables reduced to those of the greatest potential interest to sociology students. Variable names and coding have *not* been altered, so that students can rely on the survey documentation (questionnaires, codebooks) to better understand the variables in the dataset. The codebooks shown on this page describe the processed datasets. The processed datasets can be downloaded by students from the module's Canvas page for the purpose of coursework, but for all other research purposes students are asked to download the original raw data from the data repositories. The `R` code available on this page can be run on the raw datasets to reproduce the processed datasets.


# World Values Survey, Wave 7 (WVS7)

This dataset comes from the [World Values Survey Wave 7 (2017-2022)](https://www.worldvaluessurvey.org/WVSDocumentationWV7.jsp). The data (version 5.0) was downloaded in SPSS format to a local folder, `wvs7/`. The folder, which also contains the original data documentation, looks like this:

